export default function Input() {

    const [x, setx] = useState('Kida');

    let changeFunc = (e)=> {
        setx(e.target.value);
    }

    let setval = ()=>{
        let val = document.querySelector('input').value;
        console.log(val)
        console.log(document.getElementById('hhh'))
        document.getElementById('hhh').innerText = val;
    }

  return (
    <div>

        <input type="text" value={x} onChange={changeFunc}/>

        <button onClick={setval}>Click me</button>

        <p id='hhh'></p>

    </div>
  )
}
